selector_to_html = {"a[href=\"#k2\"]": "<div class=\"proof s\u00e6tning admonition\" id=\"k2\">\n<p class=\"admonition-title\"><span class=\"caption-number\">S\u00e6tning 1.4 </span> (2. kvadrats\u00e6tning)</p>\n<section class=\"s\u00e6tning-content\" id=\"proof-content\">\n<p>Lad <span class=\"math notranslate nohighlight\">\\(a\\)</span> og <span class=\"math notranslate nohighlight\">\\(b\\)</span> v\u00e6re vilk\u00e5rlige tal, da g\u00e6lder f\u00f8lgende identitet:</p>\n<div class=\"math notranslate nohighlight\">\n\\[    (a-b)^2 = a^2 + b^2 - 2ab\n    \\tag{K2} \\]</div>\n</section>\n</div>", "a[href=\"#id2\"]": "<figure class=\"align-center\" id=\"id2\">\n<a class=\"reference internal image-reference\" href=\"../../../_images/2kvadratthm.png\"><img alt=\"../../../_images/2kvadratthm.png\" src=\"../../../_images/2kvadratthm.png\" style=\"width: 613.5px; height: 243.0px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">figur 1.2 </span><span class=\"caption-text\">Visualisering af 2. kvadrats\u00e6tning.</span><a class=\"headerlink\" href=\"#id2\" title=\"Permahenvisning til dette billede\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#k0\"]": "<div class=\"proof s\u00e6tning admonition\" id=\"k0\">\n<p class=\"admonition-title\"><span class=\"caption-number\">S\u00e6tning 1.2 </span></p>\n<section class=\"s\u00e6tning-content\" id=\"proof-content\">\n<p>Lad <span class=\"math notranslate nohighlight\">\\(a\\)</span>, <span class=\"math notranslate nohighlight\">\\(b\\)</span>, <span class=\"math notranslate nohighlight\">\\(c\\)</span> og <span class=\"math notranslate nohighlight\">\\(d\\)</span> v\u00e6re vilk\u00e5rlige tal, da g\u00e6lder f\u00f8lgende identitet:</p>\n<div class=\"math notranslate nohighlight\">\n\\[    (a+b)(c+d) = ab + ac + bc + bd \n    \\tag{K0} \\]</div>\n</section>\n</div>", "a[href=\"#k3\"]": "<div class=\"proof s\u00e6tning admonition\" id=\"k3\">\n<p class=\"admonition-title\"><span class=\"caption-number\">S\u00e6tning 1.5 </span> (3. kvadrats\u00e6tning)</p>\n<section class=\"s\u00e6tning-content\" id=\"proof-content\">\n<p>Lad <span class=\"math notranslate nohighlight\">\\(a\\)</span> og <span class=\"math notranslate nohighlight\">\\(b\\)</span> v\u00e6re vilk\u00e5rlige tal, da g\u00e6lder f\u00f8lgende identitet:</p>\n<div class=\"math notranslate nohighlight\">\n\\[    (a+b)(a-b) = a^2 - b^2\n    \\tag{K3} \\]</div>\n</section>\n</div>", "a[href=\"#opgaver\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.4.2. </span>Opgaver<a class=\"headerlink\" href=\"#opgaver\" title=\"Permalink til denne overskrift\">#</a></h2>", "a[href=\"#id3\"]": "<figure class=\"align-center\" id=\"id3\">\n<a class=\"reference internal image-reference\" href=\"../../../_images/3kvadratthm.png\"><img alt=\"../../../_images/3kvadratthm.png\" src=\"../../../_images/3kvadratthm.png\" style=\"width: 613.5px; height: 233.25px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">figur 1.3 </span><span class=\"caption-text\">Visualisering af 3. kvadrats\u00e6tning.</span><a class=\"headerlink\" href=\"#id3\" title=\"Permahenvisning til dette billede\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id1\"]": "<figure class=\"align-center\" id=\"id1\">\n<a class=\"reference internal image-reference\" href=\"../../../_images/1kvadratthm.png\"><img alt=\"../../../_images/1kvadratthm.png\" src=\"../../../_images/1kvadratthm.png\" style=\"width: 613.5px; height: 242.25px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">figur 1.1 </span><span class=\"caption-text\">Visualisering af 1. kvadrats\u00e6tning.</span><a class=\"headerlink\" href=\"#id1\" title=\"Permahenvisning til dette billede\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#tre-vigtige-formler\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.4.1. </span>Tre vigtige formler<a class=\"headerlink\" href=\"#tre-vigtige-formler\" title=\"Permalink til denne overskrift\">#</a></h2><p><a class=\"reference internal\" href=\"#k0\">S\u00e6tning 1.2</a> har tre s\u00e5kaldte specialtilf\u00e6lde, som vi kender som kvadrats\u00e6tningerne. N\u00e5r vi siger kvadrat, s\u00e5 menes der 2\u2019er potens og vi vil se, at kvadrats\u00e6tningerne kan illustreres som arealer (af kvadrater) og ligeledes bevises geometrisk.</p>", "a[href=\"#kvadratsaetninger\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.4. </span>Kvadrats\u00e6tninger<a class=\"headerlink\" href=\"#kvadratsaetninger\" title=\"Permalink til denne overskrift\">#</a></h1><p>Inden vi skal til kvadrats\u00e6tningerne, s\u00e5 er det vigtigt, at vi har styr p\u00e5, hvordan vi ganger to parenteser sammen. For hvordan ganger vi parentesen sammen nedenfor?</p>", "a[href=\"#k1\"]": "<div class=\"proof s\u00e6tning admonition\" id=\"k1\">\n<p class=\"admonition-title\"><span class=\"caption-number\">S\u00e6tning 1.3 </span> (1. kvadrats\u00e6tning)</p>\n<section class=\"s\u00e6tning-content\" id=\"proof-content\">\n<p>Lad <span class=\"math notranslate nohighlight\">\\(a\\)</span> og <span class=\"math notranslate nohighlight\">\\(b\\)</span> v\u00e6re vilk\u00e5rlige tal, da g\u00e6lder f\u00f8lgende identitet:</p>\n<div class=\"math notranslate nohighlight\">\n\\[    (a+b)^2 = a^2 + b^2 + 2ab\n    \\tag{K1} \\]</div>\n</section>\n</div>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
